import './App.css';
import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';
import { BrowserRouter as Router,Switch, Route} from "react-router-dom";

const App=()=> {

    return (


         <div>
       <Router>
        <Navbar/>

        <Switch>
          <Route  path="/"><News size={6} country="in" category="general"/></Route> 
          <Route  path="/sport"><News size={6} country="in" category="sports"/></Route> 
        </Switch>

        <Footer/>
        </Router>


      </div>



    )

}
export default App;
